import React from "react";
import styled from "styled-components";
import TitleBanner from "../assets/image/titulon.png";
import { SearchBar } from "./index";

export const NavBar = () => {
  return (
    <Container>
      <header>
        <picture>
          <img style={{width: "80px"}} src={TitleBanner} alt="logo de la pagina" />
        </picture>
        <div className="search-container">
          <SearchBar />
        </div>
      </header>
    </Container>
  );
};

const Container = styled.div`
width: 100vw;
height: 100px;
display: flex;
flex-direction: row;
align-items: center;
justify-content: space-between;
position: relative;
`;
